animal.description:
I am an active 1 year old with loads of personality. My picture must not do me justice since everybody tells me I'm such a cutie! I probably should have been named Scrappy Doo because I'm so exuberant sometimes. I like to play with other dogs, and cats, too. As long as they don't mind being chased occasionally. I like to chase the ball, too, except I forget to bring it back. I am good on a leash plus I'm learning my manners and to go outside to potty. I can stay in a crate but I'd rather stay with my human. I love to make new friends so please come and meet me. Maybe you're my perfect family! 

Email: dogs@almosthomefoundation.org

Almost Home Foundation's adoption requirements:
(1) Be at least 21 years of age;
(2) Have the consent of all adults living in the household;
(3) Have approval from the residence owner;
(4) Have valid ID with current address;
(5) Be approved by Almost Home Foundation as a suitable adoptive home; and
(6) Live in the suburbs surrounding Schaumburg (Illinois Residents only)
*** Please note that Almost Home Foundation accepts only cash or checks for adoption fees; we do not accept debit or credit cards. ***
